
        export const PAGE_SIZE = 20;

        export interface Post {
            filename: string;
            slug: string;
            title: string;
            description: string;
            image: string;
            content: string;
            attributes: {
                created: string;
            } & Partial<{
                updated: string;
                tags: string[];
                related: string[];
                inbound: string[];
                author: string;
                // display settings
                imagePosition: 'top' | 'bottom';
                imagePadded: 'true' | 'false';
                className: string;
                variant: string;
                unlisted: 'true' | 'false';
                sidebar: 'show' | 'hide' | undefined;
            }>
        }

        export type Posts = Record<string, Post>;

        export const faviconUrls = {"claude.ai":"data:image/x-icon;base64,","chance.utc24.io/paper/glass-box/":"data:image/x-icon;base64,","www.cursor.com/":"data:image/png;base64,","x.com/karpathy/status/1886192184808149383":"data:image/x-icon;base64,","www.onplug.io/":"data:image/vnd.microsoft.icon;base64,","www.onplug.io":"data:image/vnd.microsoft.icon;base64,","twitter.com/drakedanner":"data:image/x-icon;base64,","twitter.com/nftchance":"data:image/x-icon;base64,","onplug.io":"data:image/vnd.microsoft.icon;base64,"} as const;

        export const posts: Posts = {infrarace:{filename:"infra-race",slug:"infra-race",title:"The Infrastructure Race.",description:"Your ability to transact limits your ability to capture alpha....",image:"/cdn/papers/infra-race.png",content:"\n\nThere's a scene in the Big Short where Brownfield Fund visits JPMorgan with the goal of getting an International Swaps and Derivatives Association (ISDA) agreement to be able to transact in long term derivatives. The owners of Brownfield saw an opportunity, but they needed an ISDA to be execute the trade. The only problem? Their AUM of $30m was \"about 1 billion 470 million short\" of the capital requirement needed to qualify for an ISDA. No ISDA, no trade.\n\n![Image from the Big Short discussing the value of the ISDA](https://cdn.onplug.io/posts/infra-race/2-isda.png)\n\nSuccess in markets is often viewed through the lens of information and execution speed but the example from The Big Short highlights an oft-overlooked third component: Transaction Infrastructure. Even if you have the best information in the world, you may not be able to execute the trade without the right infrastructure.\n\nWhile information flows and execution speed are important in crypto, this third component is exacerbated in a way that differs from historical understandings. Sure, we can talk about how to know which tokens to buy or which airdrops to hunt, we generally understand that there are MEV bots that trade faster than we can, but we rarely talk about the infrastructure that allows us to transact in the first place.\n\nI've identified 6 tiers of transaction sophistication within DeFi. Let's dig in.\n\n## Levels of Transacting\n\nWhen we transact onchain, we're competing with other users for block space. Our ability to capture alpha is limited by our transaction capabilities. Are you able to prepare the transaction required and get it into an optimal block?\n\nBut before we get onchain, let's start with the basics.\n\n### Tier 1: Centralized Exchange Users\n\nThese users are most likely spot traders or long term holders. They may utilize some of the Earn products that lend or stake their underlying tokens. They may pay a monthly fee for fee-less trading with something like Coinbase.\n\nThe vast majority of crypto participants never leave this tier. They're comfortable with familiar interfaces that mirror traditional finance platforms, and they accept the trade-offs: higher fees, centralization risk, and limited access to DeFi's innovation. For many, this is a reasonable choice—they prioritize convenience over sovereignty and potential yield.\n\n### Tier 2: Self-Custody Beginners\n\nThe leap from Tier 1 to Tier 2 represents one of the most significant psychological barriers in crypto adoption. Self-custody means taking responsibility for your assets. These users have taken their first steps into true crypto ownership, but they're still paying a premium for simplified interfaces that abstract away the complexity of the underlying protocols or failing to identify the highest upside opportunities.\n\nThey might swap or stake inside of the Ledger app or the Metamask extension but they aren't seeking out the best rates across the ecosystem.\n\n### Tier 3: Simple Protocol Users\n\nAt this tier, users begin to directly interface with the protocols that power DeFi; they're using Uniswap to swap and Blur to find NFTs. They've learned to connect their wallets to dApps and execute basic transactions. They typically interact with one protocol at a time, however, missing opportunities for composability—one of DeFi's most powerful features. Their transactions are often suboptimal, paying higher fees than necessary and frequently falling victim to MEV extraction.\n\n### Tier 4: Advanced Protocol Users\n\nTier 4 users have developed a working mental model of DeFi's ecosystem. They understand that liquidity is fragmented across protocols and use aggregators to optimize their trades. They've learned to adjust gas settings and may time their transactions to avoid network congestion. These users capture more value than those in lower tiers, but they're still executing transactions manually and reactively rather than programmatically and proactively.\n\n### Tier 5: Weapons-Grade Protocol Users\n\nThis is where the playing field begins to tilt dramatically. Tier 5 users have crossed into professional territory, viewing each transaction as a competitive event. They understand that the mempool is a battlefield where transactions compete for inclusion, and they've equipped themselves with specialized tools to gain an edge such as Flashbots MEV Protect. These users have invested significant time in understanding blockchain mechanics beyond the application layer, allowing them to execute strategies that would be impossible for users in lower tiers.\n\n### Tier 6: Custom Infrastructure Developers\n\nAt the apex of transaction sophistication are those who have built custom infrastructure tailored to their specific strategies. These are typically institutions, protocols with dedicated development teams, or sophisticated individual traders with programming backgrounds. Their systems monitor onchain and off-chain data continuously, identifying opportunities and executing complex transaction sequences without human intervention. These actors deploy capital programmatically and the alpha they capture is often invisible to lower tiers until well after the opportunity has passed.\n\n## The Infrastructure Gap\n\nThis infrastructure gap represents one of DeFi's most significant barriers to true democratization. While we celebrate the removal of traditional gatekeepers, we've created new ones based on technical capability rather than capital or credentials. The resources required to build and maintain Tier 6 infrastructure are beyond the reach of most individuals and smaller organizations, creating a new form of financial exclusion masked as meritocracy.\n\nThe gap is widening, not narrowing. As protocols become more complex and interconnected, the knowledge and infrastructure required to interact with them optimally increases exponentially. Each new innovation—from new L2s to cross-chain bridges to novel financial primitives—adds another layer of complexity that must be integrated into existing systems.\n\n## Democratizing Transaction Sophistication\n\nThis is where Plug enters the picture. We've built the infrastructure so you don't have to. Our platform provides the sophisticated transaction capabilities of Tier 6 with the accessibility of Tier 3 or 4. We believe that transaction infrastructure should be a utility, not a competitive advantage available only to the technically elite.\n\nBy abstracting away the complexity while maintaining transparency and control, we're enabling users to focus on strategy rather than execution mechanics. Whether you're looking to optimize a simple swap or orchestrate a complex cross-protocol strategy, Plug provides the infrastructure to execute it effectively.\n\n## The Future Belongs to the Infrastructure-Enabled\n\nAs DeFi continues to evolve, the advantage will increasingly shift toward those who can execute transactions most effectively. Information asymmetry is rapidly diminishing as news spreads instantly on Twitter, Discord, and Telegram. Speed advantages are being commoditized through better block builders and MEV-Share. The edge that remains is the ability to compose complex transactions that capture value across the fragmented DeFi landscape.\n\nThe future of DeFi belongs to those who can harness the full power of its composability. Not just understanding it conceptually, but having the infrastructure to execute on that understanding programmatically and reliably. This is the new frontier of financial advantage—not what you know, but how effectively you can act on what you know.\n\nDon't get left behind in the infrastructure race. Join [Plug](https://www.onplug.io/) today and take your first step toward adopting transaction infrastructure built for you.\n",attributes:{created:"2025-03-03T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},chatinterfaces:{filename:"chat-interfaces",slug:"chat-interfaces",title:"Chat Interfaces and Crypto Agents.",description:"Building the infrastructure required to enable agents to make onchain transactions....",image:"/cdn/papers/hello-world.png",content:"\n\nEvery morning, I wake up and start working with a symphony of AI assistants. Claude helps architect our systems, Cursor generates our code, ChatGPT brainstorms solutions, Perplexity researches edge cases, the list goes on. My reality is highly AI-augmented.\n\nSo when someone sends me yet another crypto agent chat interface, I get why they're excited. The promise is intoxicating...\n\n\"What if you could just tell an AI to make you money?\"\n\nJust tell an AI what you want, and it handles all the complexity of crypto for you. No more juggling DEX interfaces, tracking yield farms, or monitoring positions across chains. Just vibes and gains.\n\nBut I'm frustrated because no one has shown me an agent that can do something other than swap or bridge. No one has shown me a chat interface for transaction definition that actually works. Right now, we're swimming in demos and pitch decks while hard problems remain unsolved.\n\nAlthough it's early, there's an exciting future for these proof of concept ideas. Many societal markers point towards a future with systems that transact on behalf of humans using crypto: users believe in this future, investors believe in this future enough to fund it, builders are attempting to create this future, etc.\n\nLast week we budgeted a few hours to explore what a chat interface for Plug might look like. It is scrappy, but it's better than every single market-available \"agent\" that exists today.\n\nMorgan can read your wallet contents, build and discover Plugs to use, suggest actions based on your goals, run and schedule your Plugs, re-organize the app with a live context-based layout, etc. It only took a ~300 lines of code to significantly improve upon the experience that is readily available today.\n\n![An example of Plug's chat interface in action](https://cdn.onplug.io/posts/chat-interfaces/1-morgan.png)\n\nIf you want to try Morgan out someday, sign up for the [Plug waitlist](https://onplug.io).\n\nAfter testing other crypto AI agents and exploring the chat interface in our product, I've come to a realization: we're asking the wrong questions about what AI should do in crypto.\n\n## Current State of Crypto AI Agents\n\nThe gap between promise and reality becomes clear when we examine actual implementations. Let's look at some leading attempts at crypto AI agents to understand what their successes and limitations reveal about our current approach to AI in crypto.\n\n### Nani.ooo\n\nNani was one of the first intent agents that I came across midway through 2024 and became the first “agent” project I tried out. When I first tried nani.ooo, it was a Windows Desktop-esque experience with different apps I could click into, one of which was the chat interface. After depositing ETH, I was able to use the chat interface to swap to NEETH (their own token).\n\nWhen I try to use the interface today, the experience is more similar to ChatGPT and it does seem to try to write an intent and post it to the Nani Deployer contract.\n\n![Nani.ooo interface writing an intent using an LLM chat interface](https://cdn.onplug.io/posts/chat-interfaces/2-nani.png)\n\nWhen I click EXECUTE ON SMART WALLET, I get error messages that don’t allow me to move forward. I see that there are some other commands written to the contract on Basescan.\n\n![Basescan interface showing transactions to the Nani Deployer contract](https://cdn.onplug.io/posts/chat-interfaces/3-basescan.png)\n\nMy experience ended here. My understanding is that in it's current state, Nani is more of a set of developer tools than a consumer product.\n\n### Griffain\n\nAfter trading the $GRIFFAIN AI memecoin, I finally was able to try out the platform. I had to spend 2 SOL to get access and then ended up in an interface with a bunch of different “agents” available to me.\n\n![Griffain agent marketplace](https://cdn.onplug.io/posts/chat-interfaces/4-griffain.png)\n\nI chose to interact with the Sniper Bot and did not have the best experience. I was expecting to have a back and forth with the agent about what we’d be doing together but instead it felt like I kicked off an open script to buy memecoins based on parameters loosely defined in my sentence: Only snipe if the description mentions AI.\n\n![Griffain sniper bot](https://cdn.onplug.io/posts/chat-interfaces/5-griffain.png)\n\nWhen we think about generalized intents, should the AI help you devise the intent or should the AI write the intent for you? At which point do you give over the wheel and say send it?\n\n## The Chat Interface Oversimplification\n\nUsing a chat interface to write financial transaction instructions isn't just inefficient - it's technological regression. We've moved from command line interfaces to graphical UIs because they're more efficient, only to circle back to essentially typing commands in natural language? It's like replacing your banking app with a local bank branch.\n\nThe promise of AI isn't in making simple tasks more complicated - it's in making complex tasks more approachable. Yet current crypto chat interfaces often add unnecessary steps to straightforward operations while failing to meaningfully handle complex ones.\n\n## The Intent Behind AI Agent Usage\n\nMy user experience with these products has led me to wonder what users truly want out of chat interfaces and AI agent interactions?\nUsing LLMs in our worfklows adds value because we can…\n\n- Offload decision making and responsibility\n- Abstract complexity\n- Be met where we are informationally\n- Interact with a personality that guides and entertains us\n  Interacting with software through an anthropomorphized chat interface isn’t a wholly new concept but it’s one that has been highly re-popularized since the release of ChatGPT in late 2022.\n\n  Early story based video games could be interacted with through a chat interface that allowed players to type commands to move through the story.\n\n  While software products with buttons communicate where the boundaries are, chat interfaces allow you to think anything is possible… even if it isn’t. The blackbox aspects of LLM chatbots lead to a sense of wonder – one of the few pieces of consumer technology that still feels magical to us today.\n  But as Chance mentions in [The Glass Box](https://chance.utc24.io/paper/glass-box/):\n\n> _These models optimize for scale, minimizing the cognitive load on users. The complexity is hidden to provide an interface that \"just works.\" But here lies the flaw: the more hidden the system, the more prone it becomes to misuse, misunderstanding, and distrust. It introduces fragility where transparency could build resilience._\n\nBy trading an aspect of our autonomy for convenience and wonder when offloading decision making to opaque LLMs, we introduce room for influence and error.\n\n## Real Utility in AI Crypto Agents\n\nIn many cases, trading off nuance control to an LLM for speed in output is net positive. Earlier this month, [Andrej Karpathy](https://x.com/karpathy/status/1886192184808149383) beautifully articulated a feeling that a lot of people have been feeling recently – a type of working flow state wherein you code via prompts.\n![Andrej Karpathy vibe coding tweet](https://cdn.onplug.io/posts/chat-interfaces/8-vibecoding.png)\n\n> _There's a new kind of coding I call \"vibe coding\", where you fully give in to the vibes, embrace exponentials, and forget that the code even exists. It's possible because the LLMs (e.g. Cursor Composer w Sonnet) are getting too good. Also I just talk to Composer with SuperWhisper so I barely even touch the keyboard. I ask for the dumbest things like \"decrease the padding on the sidebar by half\" because I'm too lazy to find it. I \"Accept All\" always, I don't read the diffs anymore. When I get error messages I just copy paste them in with no comment, usually that fixes it. The code grows beyond my usual comprehension, I'd have to really read through it for a while. Sometimes the LLMs can't fix a bug so I just work around it or ask for random changes until it goes away. It's not too bad for throwaway weekend projects, but still quite amusing. I'm building a project or webapp, but it's not really coding \\- I just see stuff, say stuff, run stuff, and copy paste stuff, and it mostly works._\n\nWhen I use [Cursor](https://www.cursor.com/) and [Claude](https://claude.ai), I sometimes reach this flow state and push features faster than expected. At other times, I find myself in a deadend and have to dump active changes and restart at the most recent working commit.\n\nVibe coding works in software developments thanks to the ability to revert changes. It's a different story for onchain transactions.\n\nDo you really want to vibe code your financial activities?\n\nYou could get away with vibe coding a single trading wallet – this is essentially what I did with Griffain. I said, “Hey I’m feeling frisky today let’s buy some memecoins that fit my parameters” and lil buddy gave me exactly what I wanted.\n\n![Griffain Sniper Bot](https://cdn.onplug.io/posts/chat-interfaces/9-griffain.png)\n\nThe Griffain Sniper Bot I used started buying things quickly and I didn’t have time to respond before it chewed through my deposits; a risk of automation (especially in the context of pseudo-gambling memecoins).\n\nMy experience using AI in development shows how AI can be a powerful thought partner when building complex systems. What if we applied this same collaborative framework to crypto? Instead of asking AI to autonomously manage our assets, what if we used it to help us make better decisions about them?\n\nA different model emerges - one of purposeful collaboration rather than autonomous execution. This suggests a more nuanced approach to AI agents in crypto.\n\n## Building Infrastructure for Agents\n\nRight now, most crypto AI interfaces can swap and bridge because that's all their underlying infrastructure allows. The multi-function agentic future we envision requires more work to achieve.\n\nThis is precisely why we're building Plug the way we are. We're not starting with a chat interface or a single omniscient agent – we're building the foundational infrastructure that enables meaningful agent collaboration. A robust solver that can compose complex transactions across protocols. A growing library of protocol integrations. A framework for writing and executing generalized intents.\n\nWhen we integrate a protocol into Plug, we're expanding the universe of what's possible for every agent in the ecosystem. Each integration creates new possibilities for composition and automation. We're starting from first principles, focusing on the fundamentals that will empower both humans and agents to do more with crypto.\n",attributes:{created:"2025-02-17T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},helloworld:{filename:"say-hello",slug:"hello-world",title:"Hello World.",description:"Command centers for the future built by the terminally online....",image:"/cdn/papers/hello-world.png",content:"\n\nWe are Terminally Online Inc. and you may know us individually as [danner](https://twitter.com/drakedanner) or [chance](https://twitter.com/nftchance). We've spent the past 5 years plugged into the EVM landscape and we're here to plug you in too.\n\n## The Reality Check\n\nIf you're reading this, you probably have a setup that looks familiar: Multiple monitors, endless Discord and Telegram notifications, and more browser windows than your RAM signed up for. The state of DeFi feels like trying to play 4D chess while juggling. You've got yield farms here, LP positions there, and god forbid you try to time a transaction across multiple protocols without missing the perfect entry.\n\nWe've been there. We are there. And we're building the solution we've always wanted. Initially, when we set out to build Plug, we considered building a product that allowed users to log off and spend more time touching grass. As we continued to build, we realized - that's not who we are; that's not who you are.\n\nLet's be real - I've got 47 browser tabs open right now. This isn't just a problem to solve - it's who we are. The question isn't how to log off, it's how to become even more online. We live in the ether, we spend our days streaming our homes to those we build with. We named our company Terminally Online for a reason. We don't log off and we are here to build for others like us.\n\n## Our Journey Here\n\nI've spent my entire life seeking the cutting edge of functional technology and my entire career in early stage fintech and crypto startups. I've had the opportunity to build teams and hire across every department imaginable. I've gotten to perform a laundry list of operational and technical roles and the teams I've worked with have built systems that have processed $5b+ across compliant Web2 and Web3 rails. I've gotten to work with Chance over the years as he's enabled nearly a million gas optimized transactions and developed delightful software experiences.\nWe're excited to begin releasing product that we fully own and direct.\n\n## Meet Plug\n\nWe're not here to tell you to touch grass. We're here to build the command center for the terminally online. Your protocols, your strategies, your automations - all running exactly how you want them, when you want them. No more tab juggling required.\nFor the first time ever, you can:\n\n- Schedule constraints-driven transactions (because sometimes you need to sleep)\n- Access all major protocol functionality without bouncing between apps\n- Create and share strategies that actually make you money\n- Set up \"if this, then that\" executions that squeeze maximum value from every move\n  One interface to access Ethereum, one interface to combine protocols, one interface to schedule transactions, and one interface to manage your onchain experience.\n\n## What's Coming\n\nWe're starting with Season 0 - our founding users phase. This initial release will be referral-gated, with priority access for everyone on the Plug waitlist. Being a founding user means more than just early access; it comes with built-in advantages that persist:\n\nYour transactions will be evaluated more frequently, leading to better execution. We'll subsidize your gas costs on L2s, and you'll get early access to new features as we roll them out.\n\nWe're taking a seasonal approach to give us flexibility - each season lasting between one to several months. This structure lets us integrate new protocols, test incentive alignment mechanisms, and evolve the product ecosystem based on what we learn together.\n\nWhen we transition to Season 1, our founding users keep their enhanced capabilities. We're building Plug for the long term, and we want our earliest users to remain at the forefront of its evolution.\n\n## The Future\n\nThis isn't just another DeFi tool. We're building the infrastructure for the next generation of onchain activity. A platform where users can compose, automate, and execute complex strategies without compromising on control or capability. This is about unlocking the true potential of being terminally online.\n\nReady to plug in? Join the waitlist at [onplug.io](https://www.onplug.io).\n",attributes:{created:"2025-01-28T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}}};

        // * Get all the Posts for a given page.
        export const getPosts = (
            page = 1,
            pageSize = PAGE_SIZE,
            filter?:
                | Partial<Record<'date' | 'tag' | 'search', Partial<string>>>
                | undefined
        ): {
            posts: Post[]
            count: number
            hasNext: boolean
            random: Post
        } => {
            // ! Filter the posts before paginating so that we can get a final count.
            const filteredPosts = Object.values(
                Object.values(posts ?? {}).reduce<Record<string, Post>>(
                    (acc, article) => {
                        if(article.attributes.unlisted) return acc

                        if (!filter) {
                            acc[article.slug] = article

                            return acc
                        }

                        const { tag, date, search } = filter

                        // * Check the lowercase tags against the lowercase tag parameter.
                        const matchesTag =
                            !tag ||
                            (article.attributes.tags?.some(
                                articleTag =>
                                    articleTag.toLowerCase() === tag.toLowerCase()
                            ) ??
                                false)

                        // ! Require the exact date match.
                        const matchesDate =
                            !date ||
                            ((article.attributes.created?.includes(date) ||
                                article.attributes.updated?.includes(date)) ??
                                false)

                        const matchesSearch =
                            !search ||
                            article.title
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            article.description
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            article.content
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            (article.attributes.tags?.some(articleTag =>
                                articleTag.toLowerCase().includes(search.toLowerCase())
                            ) ??
                                false)

                        if (matchesTag && matchesDate && matchesSearch) {
                            acc[article.slug] = article
                        }

                        return acc
                    },
                    {}
                )
            )

            const count = filteredPosts.length
            const keys = Object.keys(posts)

            return {
                posts: filteredPosts.slice(
                    (page - 1) * pageSize,
                    page * pageSize
                ),
                count,
                hasNext: count > page * pageSize,
                random: posts[keys[Math.floor(Math.random() * keys.length)]]
            }
        }

        // * Get a specific Post by the value of the slug parameter in each Post.
        // ! The parameter can be the dictionary key or the slug which is a slug on the Post.
        export type PostLookupKey = keyof typeof posts
        export type PostLookup = (typeof posts)[PostLookupKey]['slug']

        export const getPost = (lookup: PostLookup) => {
            const article = posts[lookup.replaceAll('-', '') as PostLookupKey]

            if (!article) throw new Error('Post not found')

            return article
        }

        // * Get the favicon for a given URL.
        export const getFavicon = (url?: string) => {
            if (!url) return null

            const faviconUrl =
                faviconUrls[
                    url
                        .replace('https://', '')
                        .replace('http://', '') as keyof typeof faviconUrls
                ]

            if (!faviconUrl) return null

            return faviconUrl
        }
        